import {episodes} from './../data/podcastData'
import PodcastItm from './PodcastItm'
import SearchPodcast from './SearchPodcast'

function PodcastList() {
  return (    <div>
        <SearchPodcast />
        <h4>Podcast Publicados </h4>

            {episodes.map( (itm)=>{
                return(
                    <PodcastItm itm={itm} />  )    }
            )
            }
        </div>  )   }

export default PodcastList
